import useAuth from "../hooks/useAuth";

function LogoutPage() {
    if (useAuth) {
        return fetch(`/logout`, {
            'method': 'POST',
            headers: {
                'Content-Type': 'application/json'
            }
        })
            .then(response => response.json())
            .catch(error => console.log(error))

    }
    return window.location.replace("/index")
}

export default LogoutPage
